import React from "react";

const Dashboard = (props) =>{

    const handleLogout = () =>{
        props.history.push('/components/login');
    }

    return(

        <div>
            Welcome to DashBoard Page!<br/><br/>
            <input type="button" value='Logout' onClick={handleLogout}/>

        </div>
    )
}

export default Dashboard;
